(1, 'default', 'Terms of Service', 'terms-of-service', '<p><strong>OVERVIEW</strong></p><p>This website is operated by Cartify. Throughout the site, the terms “we”, “us” and “our” refer to Cartify. Cartify offers this website, including all information, tools and services available from this site to you, the user, conditioned upon your acceptance of all terms, conditions, policies and notices stated here. </p><p>By visiting our site and/ or purchasing something from us, you engage in our “Service” and agree to be bound by the following terms and conditions (“Terms of Service”, “Terms”), including those additional terms and conditions and policies referenced herein and/or available by hyperlink. These Terms of Service apply  to all users of the site, including without limitation users who are browsers, vendors, customers, merchants, and/ or contributors of content.</p><p>Please read these Terms of Service carefully before accessing or using our website. By accessing or using any part of the site, you agree to be bound by these Terms of Service. If you do not agree to all the terms and conditions of this agreement, then you may not access the website or use any services. If these Terms of Service are considered an offer, acceptance is expressly limited to these Terms of Service. </p><p>Any new features or tools which are added to the current store shall also be subject to the Terms of Service. You can review the most current version of the Terms of Service at any time on this page. We reserve the right to update, change or replace any part of these Terms of Service by posting updates and/or changes to our website. It is your responsibility to check this page periodically for changes. Your continued use of or access to the website following the posting of any changes constitutes acceptance of those changes.</p><p>Our store is hosted on Shopify Inc. They provide us with the online e-commerce platform that allows us to sell our products and services to you. </p><p><strong>SECTION 1 - ONLINE STORE TERMS</strong></p><p>By agreeing to these Terms of Service, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence and you have given us your consent to allow any of your minor dependents to use this site. </p><p>You may not use our products for any illegal or unauthorized purpose nor may you, in the use of the Service, violate any laws in your jurisdiction (including but not limited to copyright laws).</p><p>You must not transmit any worms or viruses or any code of a destructive nature.</p><p>A breach or violation of any of the Terms will result in an immediate termination of your Services.</p><p><strong>SECTION 2 - GENERAL CONDITIONS</strong></p><p>We reserve the right to refuse service to anyone for any reason at any time.</p><p>You understand that your content (not including credit card information), may be transferred unencrypted and involve (a) transmissions over various networks; and (b) changes to conform and adapt to technical requirements of connecting networks or devices. Credit card information is always encrypted during transfer over networks.</p><p>You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service or any contact on the website through which the service is provided, without express written permission by us.</p><p>The headings used in this agreement are included for convenience only and will not limit or otherwise affect these Terms.</p><p><strong>SECTION 3 - ACCURACY, COMPLETENESS AND TIMELINESS OF INFORMATION </strong></p><p>We are not responsible if information made available on this site is not accurate, complete or current. The material on this site is provided for general information only and should not be relied upon or used as the sole basis for making decisions without consulting primary, more accurate, more complete or more timely sources of information. Any reliance on the material on this site is at your own risk. </p><p>This site may contain certain historical information. Historical information, necessarily, is not current and is provided for your reference only. We reserve the right to modify the contents of this site at any time, but we have no obligation to update any information on our site. You agree that it is your responsibility to monitor changes to our site.</p><p><strong>SECTION 4 - MODIFICATIONS TO THE SERVICE AND PRICES</strong></p><p>Prices for our products are subject to change without notice.</p><p>We reserve the right at any time to modify or discontinue the Service (or any part or content thereof) without notice at any time.</p><p>We shall not be liable to you or to any third-party for any modification, price change, suspension or discontinuance of the Service.</p><p><strong>SECTION 5 - PRODUCTS OR SERVICES (if applicable)</strong></p><p>Certain products or services may be available exclusively online through the website. These products or services may have limited quantities and are subject to return or exchange only according to our Return Policy.</p><p>We have made every effort to display as accurately as possible the colors and images of our products that appear at the store. We cannot guarantee that your computer monitor\'s display of any color will be accurate.</p><p>We reserve the right, but are not obligated, to limit the sales of our products or Services to any person, geographic region or jurisdiction. We may exercise this right on a case-by-case basis. We reserve the right to limit the quantities of any products or services that we offer. All descriptions of products or product pricing are subject to change at anytime without notice, at the sole discretion of us. We reserve the right to discontinue any product at any time. Any offer for any product or service made on this site is void where prohibited.</p><p>We do not warrant that the quality of any products, services, information, or other material purchased or obtained by you will meet your expectations, or that any errors in the Service will be corrected.</p><p><strong>SECTION 6 - ACCURACY OF BILLING AND ACCOUNT INFORMATION</strong></p><p>We reserve the right to refuse any order you place with us. We may, in our sole discretion, limit or cancel quantities purchased per person, per household or per order. These restrictions may include orders placed by or under the same customer account, the same credit card, and/or orders that use the same billing and/or shipping address. In the event that we make a change to or cancel an order, we may attempt to notify you by contacting the e-mail and/or billing address/phone number provided at the time the order was made. We reserve the right to limit or prohibit orders that, in our sole judgment, appear to be placed by dealers, resellers or distributors.</p><p>You agree to provide current, complete and accurate purchase and account information for all purchases made at our store. You agree to promptly update your account and other information, including your email address and credit card numbers and expiration dates, so that we can complete your transactions and contact you as needed.</p><p>For more detail, please review our Returns Policy.</p><p><strong>SECTION 7 - OPTIONAL TOOLS</strong></p><p>We may provide you with access to third-party tools over which we neither monitor nor have any control nor input.</p><p>You acknowledge and agree that we provide access to such tools ”as is” and “as available” without any warranties, representations or conditions of any kind and without any endorsement. We shall have no liability whatsoever arising from or relating to your use of optional third-party tools.</p><p>Any use by you of optional tools offered through the site is entirely at your own risk and discretion and you should ensure that you are familiar with and approve of the terms on which tools are provided by the relevant third-party provider(s).</p><p>We may also, in the future, offer new services and/or features through the website (including, the release of new tools and resources). Such new features and/or services shall also be subject to these Terms of Service.</p><p>Text Marketing and Notifications: </p><p>By subscribing to text notifications you agree to receive recurring automated marketing messages at the phone number provided. Consent is not a condition of purchase. Reply STOP to unsubscribe. HELP for help. Msg &amp; Data rates may apply. More info view Privacy Policy and ToS.</p><p><strong>SECTION 8 - THIRD-PARTY LINKS</strong></p><p>Certain content, products and services available via our Service may include materials from third-parties.</p><p>Third-party links on this site may direct you to third-party websites that are not affiliated with us. We are not responsible for examining or evaluating the content or accuracy and we do not warrant and will not have any liability or responsibility for any third-party materials or websites, or for any other materials, products, or services of third-parties.</p><p>We are not liable for any harm or damages related to the purchase or use of goods, services, resources, content, or any other transactions made in connection with any third-party websites. Please review carefully the third-party\'s policies and practices and make sure you understand them before you engage in any transaction. Complaints, claims, concerns, or questions regarding third-party products should be directed to the third-party.</p><p><strong>SECTION 9 - USER COMMENTS, FEEDBACK AND OTHER SUBMISSIONS</strong></p><p>If, at our request, you send certain specific submissions (for example contest entries) or without a request from us you send creative ideas, suggestions, proposals, plans, or other materials, whether online, by email, by postal mail, or otherwise (collectively, \'comments\'), you agree that we may, at any time, without restriction, edit, copy, publish, distribute, translate and otherwise use in any medium any comments that you forward to us. We are and shall be under no obligation (1) to maintain any comments in confidence; (2) to pay compensation for any comments; or (3) to respond to any comments. </p><p>We may, but have no obligation to, monitor, edit or remove content that we determine in our sole discretion are unlawful, offensive, threatening, libelous, defamatory, pornographic, obscene or otherwise objectionable or violates any party’s intellectual property or these Terms of Service.</p><p>You agree that your comments will not violate any right of any third-party, including copyright, trademark, privacy, personality or other personal or proprietary right. You further agree that your comments will not contain libelous or otherwise unlawful, abusive or obscene material, or contain any computer virus or other malware that could in any way affect the operation of the Service or any related website. You may not use a false e-mail address, pretend to be someone other than yourself, or otherwise mislead us or third-parties as to the origin of any comments. You are solely responsible for any comments you make and their accuracy. We take no responsibility and assume no liability for any comments posted by you or any third-party.</p><p><strong>SECTION 10 - PERSONAL INFORMATION</strong></p><p>Your submission of personal information through the store is governed by our Privacy Policy. </p><p><strong>SECTION 11 - ERRORS, INACCURACIES AND OMISSIONS</strong></p><p>Occasionally there may be information on our site or in the Service that contains typographical errors, inaccuracies or omissions that may relate to product descriptions, pricing, promotions, offers, product shipping charges, transit times and availability. We reserve the right to correct any errors, inaccuracies or omissions, and to change or update information or cancel orders if any information in the Service or on any related website is inaccurate at any time without prior notice (including after you have submitted your order).</p><p>We undertake no obligation to update, amend or clarify information in the Service or on any related website, including without limitation, pricing information, except as required by law. No specified update or refresh date applied in the Service or on any related website, should be taken to indicate that all information in the Service or on any related website has been modified or updated. </p><p><strong>SECTION 12 - PROHIBITED USES</strong></p><p>In addition to other prohibitions as set forth in the Terms of Service, you are prohibited from using the site or its content: (a) for any unlawful purpose; (b) to solicit others to perform or participate in any unlawful acts; (c) to violate any international, federal, provincial or state regulations, rules, laws, or local ordinances; (d) to infringe upon or violate our intellectual property rights or the intellectual property rights of others; (e) to harass, abuse, insult, harm, defame, slander, disparage, intimidate, or discriminate based on gender, sexual orientation, religion, ethnicity, race, age, national origin, or disability; (f) to submit false or misleading information; (g) to upload or transmit viruses or any other type of malicious code that will or may be used in any way that will affect the functionality or operation of the Service or of any related website, other websites, or the Internet; (h) to collect or track the personal information of others; (i) to spam, phish, pharm, pretext, spider, crawl, or scrape; (j) for any obscene or immoral purpose; or (k) to interfere with or circumvent the security features of the Service or any related website, other websites, or the Internet. We reserve the right to terminate your use of the Service or any related website for violating any of the prohibited uses.</p><p><strong>SECTION 13 - DISCLAIMER OF WARRANTIES; LIMITATION OF LIABILITY</strong></p><p>We do not guarantee, represent or warrant that your use of our service will be uninterrupted, timely, secure or error-free. </p><p>We do not warrant that the results that may be obtained from the use of the service will be accurate or reliable. </p><p>You agree that from time to time we may remove the service for indefinite periods of time or cancel the service at any time, without notice to you.</p><p>You expressly agree that your use of, or inability to use, the service is at your sole risk. The service and all products and services delivered to you through the service are (except as expressly stated by us) provided \'as is\' and \'as available\' for your use, without any representation, warranties or conditions of any kind, either express or implied, including all implied warranties or conditions of merchantability, merchantable quality, fitness for a particular purpose, durability, title, and non-infringement.</p><p>In no case shall Cartify, our directors, officers, employees, affiliates, agents, contractors, interns, suppliers, service providers or licensors be liable for any injury, loss, claim, or any direct, indirect, incidental, punitive, special, or consequential damages of any kind, including, without limitation lost profits, lost revenue, lost savings, loss of data, replacement costs, or any similar damages, whether based in contract, tort (including negligence), strict liability or otherwise, arising from your use of any of the service or any products procured using the service, or for any other claim related in any way to your use of the service or any product, including, but not limited to, any errors or omissions in any content, or any loss or damage of any kind incurred as a result of the use of the service or any content (or product) posted, transmitted, or otherwise made available via the service, even if advised of their possibility. Because some states or jurisdictions do not allow the exclusion or the limitation of liability for consequential or incidental damages, in such states or jurisdictions, our liability shall be limited to the maximum extent permitted by law.</p><p><strong>SECTION 14 - INDEMNIFICATION</strong></p><p>You agree to indemnify, defend and hold harmless Cartify and our parent, subsidiaries, affiliates, partners, officers, directors, agents, contractors, licensors, service providers, subcontractors, suppliers, interns and employees, harmless from any claim or demand, including reasonable attorneys’ fees, made by any third-party due to or arising out of your breach of these Terms of Service or the documents they incorporate by reference, or your violation of any law or the rights of a third-party.</p><p><strong>SECTION 15 - SEVERABILITY</strong></p><p>In the event that any provision of these Terms of Service is determined to be unlawful, void or unenforceable, such provision shall nonetheless be enforceable to the fullest extent permitted by applicable law, and the unenforceable portion shall be deemed to be severed from these Terms of Service, such determination shall not affect the validity and enforceability of any other remaining provisions.</p><p><strong>SECTION 16 - TERMINATION</strong></p><p>The obligations and liabilities of the parties incurred prior to the termination date shall survive the termination of this agreement for all purposes.</p><p>These Terms of Service are effective unless and until terminated by either you or us. You may terminate these Terms of Service at any time by notifying us that you no longer wish to use our Services, or when you cease using our site.</p><p>If in our sole judgment you fail, or we suspect that you have failed, to comply with any term or provision of these Terms of Service, we also may terminate this agreement at any time without notice and you will remain liable for all amounts due up to and including the date of termination; and/or accordingly may deny you access to our Services (or any part thereof).</p><p><strong>SECTION 17 - ENTIRE AGREEMENT</strong></p><p>The failure of us to exercise or enforce any right or provision of these Terms of Service shall not constitute a waiver of such right or provision. </p><p>These Terms of Service and any policies or operating rules posted by us on this site or in respect to The Service constitutes the entire agreement and understanding between you and us and govern your use of the Service, superseding any prior or contemporaneous agreements, communications and proposals, whether oral or written, between you and us (including, but not limited to, any prior versions of the Terms of Service).</p><p>Any ambiguities in the interpretation of these Terms of Service shall not be construed against the drafting party.</p><p><strong>SECTION 18 - GOVERNING LAW</strong></p><p>These Terms of Service and any separate agreements whereby we provide you Services shall be governed by and construed in accordance with the laws of 444 N. 3rd St, Floor 6, Philadelphia US 19123.</p><p><strong>SECTION 19 - CHANGES TO TERMS OF SERVICE</strong></p><p>You can review the most current version of the Terms of Service at any time at this page. </p><p>We reserve the right, at our sole discretion, to update, change or replace any part of these Terms of Service by posting updates and changes to our website. It is your responsibility to check our website periodically for changes. Your continued use of or access to our website or the Service following the posting of any changes to these Terms of Service constitutes acceptance of those changes.</p><p><strong>SECTION 20 - CONTACT INFORMATION</strong></p><p>Questions about the Terms of Service should be sent to us at <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"mailto:support@cartify.dev\">support@cartify.dev</a>.</p>', NULL, NULL, '2023-06-22 20:19:28', '2023-06-22 20:19:19', '2023-06-22 20:19:28'),
(2, 'default', 'Privacy Statement', 'privacy-statement', '<p><strong>SECTION 1 - WHAT DO WE DO WITH YOUR INFORMATION?</strong></p><p>When you purchase something from our store, as part of the buying and selling process, we collect the personal information you give us such as your name, address and email address. </p><p>When you browse our store, we also automatically receive your computer’s internet protocol (IP) address in order to provide us with information that helps us learn about your browser and operating system.</p><p>Email marketing (if applicable): With your permission, we may send you emails about our store, new products and other updates. </p><p><strong>SECTION 2 - CONSENT</strong></p><p>How do you get my consent?</p><p>When you provide us with personal information to complete a transaction, verify your credit card, place an order, arrange for a delivery or return a purchase, we imply that you consent to our collecting it and using it for that specific reason only.</p><p>If we ask for your personal information for a secondary reason, like marketing, we will either ask you directly for your expressed consent, or provide you with an opportunity to say no. </p><p>How do I withdraw my consent?</p><p>If after you opt-in, you change your mind, you may withdraw your consent for us to contact you, for the continued collection, use or disclosure of your information, at anytime, by contacting us at <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"mailto:support@novabolt.dev\">support@novabolt.dev</a> or mailing us at:</p><p><strong>SECTION 3 - DISCLOSURE</strong></p><p>We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service. </p><p><strong>SECTION 4 - THIRD-PARTY SERVICES</strong></p><p>In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary to allow them to perform the services they provide to us.  </p><p>However, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.</p><p>For these providers, we recommend that you read their privacy policies so you can understand the manner in which your personal information will be handled by these providers.  </p><p>In particular, remember that certain providers may be located in or have facilities that are located a different jurisdiction than either you or us. So if you elect to proceed with a transaction that involves the services of a third-party service provider, then your information may become subject to the laws of the jurisdiction(s) in which that service provider or its facilities are located.</p><p>As an example, if you are located in Canada and your transaction is processed by a payment gateway located in the United States, then your personal information used in completing that transaction may be subject to disclosure under United States legislation, including the Patriot Act.</p><p>Once you leave our store’s website or are redirected to a third-party website or application, you are no longer governed by this Privacy Policy or our website’s Terms of Service. </p><p>We use third parties to improve our ability to identify visitors to our website. As part of this service, we may make available identifiers to these third parties including our visitors’ IP addresses, cookies, and hashed versions of email addresses captured from your visit. We, and third parties, use this data to obtain more information about our visitors and reach out to them through other channels, such as email and/or direct mail. You have the right to opt-out of this activity.</p><p><strong>SECTION 5 - TEXT MARKETING AND NOTIFICATIONS</strong></p><p>By subscribing to text notifications you agree to receive recurring automated marketing messages at the phone number provided. Consent is not a condition of purchase. You may elect to receive text messages from us. When you sign up to receive text messages, we will send you information about promotional offers and more These messages may use information automatically collected based on your actions while on our sites and may prompt messaging such as cart abandon messages. To the extent you voluntarily opt to have Text notifications sent directly to your mobile phone, we receive and store the information you provide, including your telephone number or when you read a text message. You may opt out of receiving text messages at any time by texting “STOP” to our text messages.For more information about text messages, see our Terms and Conditions.</p><p>If you elect to receive marketing text messages from us, either via our website or by sending a text message indicating your consent, you are providing your prior express written consent to receive recurring marketing or promotional Text text messages from us (each, a “Text Message”) sent through an automatic telephone dialing system. These may include cart abandon messages. Message frequency varies. This service is optional and is not a condition for purchase. You can opt out of receiving any further Text Messages from us at any time by replying “STOP” to any Text Message you receive from us. For help, reply “HELP” to any Text Message you receive from us or email <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"mailto:textsupport@wunderkind.co\">textsupport@wunderkind.co</a>. In addition to any fee of which you are notified, your mobile provider’s message and data rates may apply to our confirmation Text Message and all subsequent Text Message correspondence according to your individual rate plan provided by your wireless carrier. Please consult your mobile service carrier’s pricing plan to determine the charges for browsing data and sending and receiving Text Messages. Under no circumstances will we or our affiliates be responsible for any Text messaging or wireless charges incurred by you or by a person that has access to your wireless device or telephone number. If your carrier does not permit Text messages, you may not receive the Text Messages. Neither we nor the wireless carriers (such as T-Mobile) will be liable for any delays in the receipt of, or failure to deliver, any Text Messages, as delivery is subject to effective transmission from your network operator. Text Message services are provided on an “AS IS” basis. Data obtained from you in connection with any Text Message services may include your cell phone number, your provider’s name and the date, time and content of your text messages. We may use this information in accordance with our Privacy Policy to contact you and to provide the services you request from us. If you change or deactivate the phone number you provided, you have an affirmative obligation to update your account information and the phone number(s) attached to your account to prevent us from inadvertently communicating with anyone who acquires any phone number(s) previously attributed to you, and any new phone number(s) you attach to your account may receive our standard marketing Text Messages unless you also unsubscribe via the above procedures.</p><p>When you click on links on our store, they may direct you away from our site. We are not responsible for the privacy practices of other sites and encourage you to read their privacy statements.</p><p><strong>SECTION 6 - SECURITY</strong></p><p>To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.</p><p>If you provide us with your credit card information, the information is encrypted using secure socket layer technology (SSL) and stored with a AES-256 encryption.  Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all PCI-DSS requirements and implement additional generally accepted industry standards.</p><p><strong>SECTION 7 - AGE OF CONSENT</strong></p><p>By using this site, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence and you have given us your consent to allow any of your minor dependents to use this site.</p><p><strong>SECTION 8 - CHANGES TO THIS PRIVACY POLICY</strong></p><p>We reserve the right to modify this privacy policy at any time, so please review it frequently. Changes and clarifications will take effect immediately upon their posting on the website. If we make material changes to this policy, we will notify you here that it has been updated, so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we use and/or disclose it.</p><p>If our store is acquired or merged with another company, your information may be transferred to the new owners so that we may continue to sell products to you.</p><p></p>', NULL, NULL, '2023-06-22 20:23:13', '2023-06-22 20:22:04', '2023-06-22 20:23:13'),
(3, 'default', 'Shipping', 'shipping', '<h2>General Shipping &amp; Processing</h2><p>Orders can take<strong>&nbsp;1-4 business days</strong> to process before shipping. Once your order has been placed your shipping option cannot be changed. Unless otherwise noted on the product page,&nbsp;all orders ship from Easton, PA (18045).&nbsp;</p><p style=\"text-align: start\"><strong>Note: </strong>FedEx, DHL, and USPS are experiencing some transit delays. Tracking details may be slower than normal to update. Your order should still be safe in transit. Please allow for additional time for all deliveries.</p><hr><h3>Shipping Within the USA (excluding HI &amp; AK)</h3><h4><u>Continental US Standard Shipping</u></h4><p><strong>Cost</strong>: $9.99 within the Continental US</p><p><strong>Estimated processing</strong>: 1-4 business days</p><p><strong>Estimated delivery</strong>: 4-10 business days </p><p><strong>Shipping details</strong>: If Standard Shipping is selected, your order may ship via a variety of carriers (DHL SmartMail or FedEx SmartPost). Some FedEx and DHL orders may be delivered by the Postal Service. Your shipping confirmation email will provide you with a tracking link. Please allow up to 72 business hours for your tracking link to update. </p><h4><u>Ground Shipping</u></h4><p><strong>Cost</strong>: $15 within the Continental US</p><p><strong>Estimated processing</strong>: 1-4 business days</p><p><strong>Estimated delivery</strong>: 3-8 business days</p><p><strong>Shipping details</strong>: Our most eco-friendly shipping option. Most orders ship with FedEx Ground, but we may use a different shipping method to get your order to you as efficiently as possible. </p><h4><u>Express Shipping</u></h4><p><strong>Cost</strong>: $22 within the Continental US</p><p><strong>Estimated processing</strong>: 1 business days</p><p><strong>Estimated delivery</strong>: 3-4 business days</p><p><strong>Shipping details</strong>: Orders placed after 1 PM EST will not ship until the next business day. Orders shipped to PO Boxes, APO/FPO, Alaska, Hawaii, and US territories cannot be expedited.</p><h4><u>Overnight Shipping</u></h4><p><strong>Cost</strong>: $34 within the Continental US</p><p><strong>Estimated processing</strong>: 1 business days</p><p><strong>Estimated delivery</strong>: 1-2 business days</p><p><strong>Shipping details</strong>: Orders placed M-F before 1 PM EST should ship the same day. Orders placed after that time should ship the following business day. Orders shipped to PO Boxes, APO/FPO, Alaska, Hawaii, and US territories cannot be expedited.</p><hr><h3>Shipping to Hawaii &amp; Alaska </h3><h4><u>Standard Shipping</u></h4><p><strong>Cost</strong>: $15</p><p><strong>Estimated processing</strong>: 1-3 business days</p><p><strong>Estimated delivery</strong>: 6-10 business days </p><p><strong>Shipping details</strong>: Most orders ship with USPS, but we may use a different shipping method to get your order to you as efficiently as possible.</p><hr><h3>International Shipping to Canada</h3><h4><u>Standard Shipping to CA</u></h4><p><strong>Cost</strong>: $25</p><p><strong>Estimated processing</strong>: 1-4 business days</p><p><strong>Estimated delivery</strong>: 6-10 business days </p><p><strong>Shipping details</strong>: Most orders ship with USPS, but we may use a different shipping method to get your order to you as efficiently as possible. International orders may experience delays in customs. Customers with shipping addresses outside of the US are solely responsible for all duties, import taxes and brokerage fees. These are not included in the cost of shipping or handling of your order. Customs, duties, and taxes vary widely from country to country; please check with your local customs agency for details on estimated costs. If you refuse a shipment because of unexpected import fees, shipping charges will not be refunded (but we are happy to work with you to get the goods back to your door).</p><hr><h3>All Other International Shipping</h3><h4><u>Standard International</u></h4><p><strong>Cost</strong>: $45 flat rate</p><p><strong>Estimated processing</strong>: 1-4 business days</p><p><strong>Estimated delivery</strong>: 8-10 business days </p><p><strong>Shipping details</strong>: Shipping service varies based on destination country. International orders may experience delays in customs. Customers with shipping addresses outside of the US are solely responsible for all duties, import taxes and brokerage fees. These are not included in the cost of shipping or handling of your order. Customs, duties, and taxes vary widely from country to country; please check with your local customs agency for details on estimated costs. If you refuse a shipment because of unexpected import fees, shipping charges will not be refunded (but we are happy to work with you to get the goods back to your door). Please note that orders shipping to an APO address may be delivered outside of the standard shipping window. It\'s possible for tracking updates to stop at point of country exit when the package is handed off to the Military Postal Service Agency.</p>', NULL, NULL, '2023-06-22 20:23:27', '2023-06-22 20:23:23', '2023-06-22 20:23:27'),
(4, 'default', 'Free Exchanges & Easy Returns', 'free-exchanges-easy-returns', '<p>Don’t worry, we understand. That’s why we have a 30-day return policy for just about every* product at Cartify. Here are a few things to note if you’re making a return:</p><h2>THE NITTY GRITTY</h2><p>Most* Cartify products are guaranteed for 30 days after the purchase date. If any issues arise during that time, the item can be returned for a refund or exchange. Items must have been purchased from <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://cartify.dev\">cartify.dev</a> and must be returned in their original condition (unwashed and unworn with tags, and in their original packaging). If used items are returned, a partial refund may be given in the form of store credit.</p><p><em>*The following items do not qualify for returns or exchanges: items marked as final sale, mystery boxes, gift cards, ReAnimator coffee, and warehouse sale purchases.</em></p><h3>Two Ways to Return</h3><p><strong>1. In person at a Happy Returns Return Bar</strong></p><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://cartify.dev\">Click here</a> to find a location near you and begin the process online. Once you’ve started the process online, you can make your return by bringing your unworn, unwashed item(s) along with the provided QR code to a Returns Bar. Your refund or exchange will be initiated immediately once the transaction is completed. Are you a Blue Crew member in the Wave Maker or Force of Nature tier? You qualify for free returns in the US! Otherwise, all refunds require a $4.00 processing fee, which will automatically be deducted from your refund. Exchanges and returns for store credit are free.</p><p><strong>2. By mail</strong></p><p>Visit our Returns Center and print a shipping label to drop off at a USPS location of your choice. You’ll receive an email when your return has been scanned and your refund has been processed, or when your exchange order has shipped. Are you a Blue Crew member in the Wave Maker or Force of Nature tier? You qualify for free returns in the US! Otherwise, all refunds require an $8.00 processing fee, which will automatically be deducted from your refund. Exchanges and returns for store credit are free.</p><p>If you select an exchange, but the item sells out before your return is finalized, the exchange will default to a refund.</p><p><strong>Returning an item that shipped from another brand?</strong></p><p>If you ordered an item and it shipped directly from a third-party brand, get in touch with us so we can help you with the process.</p>', NULL, NULL, '2023-06-22 20:24:23', '2023-06-22 20:24:16', '2023-06-22 20:24:23'),
(5, 'default', 'About us', 'about-us', '<p>Welcome to Cartify, your ultimate destination for all things gaming and entertainment! At Cartify, we are passionate about providing gamers with a seamless online shopping experience and access to the latest and greatest in gaming products.</p><p style=\"text-align: start\">Our Mission: At Cartify, our mission is to fuel your gaming obsession by offering a wide range of high-quality gaming gear, accessories, and merchandise. We aim to create a vibrant and inclusive community where gamers of all levels can come together to explore, discover, and elevate their gaming experiences.</p><p style=\"text-align: start\">Why Choose Cartify:</p><ol><li><p>Unparalleled Selection: We curate an extensive collection of gaming products from leading brands, ensuring you have access to the latest consoles, games, controllers, accessories, and more. Whatever you need to enhance your gaming setup, you\'ll find it at Cartify.</p></li><li><p>Quality Assurance: We are committed to delivering products of the highest quality. Our team carefully selects each item we offer, focusing on durability, performance, and innovation. You can shop with confidence knowing that every product on our platform meets our rigorous standards.</p></li><li><p>Exceptional Customer Service: At Cartify, we prioritize your satisfaction. Our friendly and knowledgeable customer support team is always ready to assist you with any inquiries, provide recommendations, or address any concerns you may have. We value your feedback and strive to exceed your expectations.</p></li><li><p>Community-driven Approach: We believe that gaming is more than just a hobby; it\'s a lifestyle. That\'s why we foster a thriving community of gamers, where you can connect, share experiences, and stay up-to-date with the latest gaming news, events, and trends.</p></li></ol><p style=\"text-align: start\">Join the Cartify Community: Follow us on social media, join our gaming forums, and subscribe to our newsletter to stay connected with the Cartify community. We regularly organize contests, giveaways, and exclusive promotions for our loyal customers, ensuring you never miss out on exciting opportunities.</p><p style=\"text-align: start\">Your gaming journey starts here at Cartify. Explore our store, discover new gaming experiences, and let us be your trusted partner in all things gaming.</p><p style=\"text-align: start\">Contact Us: We love hearing from our customers! If you have any questions, feedback, or suggestions, please don\'t hesitate to reach out to our dedicated support team. You can contact us via email, phone, or through the contact form on our website.</p><p style=\"text-align: start\">Thank you for choosing Cartify as your go-to gaming store. We appreciate your support, and we look forward to serving you and enhancing your gaming adventures!</p>', NULL, NULL, '2023-06-22 20:32:03', '2023-06-22 20:31:52', '2023-06-22 20:32:03'),
(6, 'default', 'Careers', 'careers', '<p>Join Our Team</p><p style=\"text-align: start\">At Cartify, we believe that our success is driven by the talent, dedication, and passion of our team members. We are always on the lookout for talented individuals who share our love for gaming and want to be part of our exciting journey. Join us and become a valuable contributor to our mission of providing gamers with the ultimate gaming experience.</p><p style=\"text-align: start\">Why Work with Us:</p><ol><li><p>Thriving Gaming Community: Cartify is more than just an e-commerce store. We have built a thriving gaming community where passionate gamers can connect, share experiences, and stay up-to-date with the latest trends. As a team member, you\'ll have the opportunity to engage with fellow gamers and contribute to the growth of our vibrant community.</p></li><li><p>Innovation and Creativity: We embrace innovation and encourage creative thinking. At Cartify, you\'ll have the freedom to explore new ideas, contribute to the development of our platform, and shape the future of gaming. We value your unique perspectives and ideas and provide an environment that nurtures creativity.</p></li><li><p>Career Growth: We are committed to the growth and development of our team members. We provide opportunities for skill enhancement, training programs, and mentorship to help you advance in your career. As we continue to expand, there will be ample chances for growth and taking on new challenges.</p></li><li><p>Collaborative Environment: Collaboration is at the heart of our success. At Cartify, you\'ll be part of a dynamic and inclusive work environment where teamwork and mutual support are highly valued. We believe in the power of diversity and encourage an atmosphere of respect, open communication, and collaboration.</p></li></ol><p style=\"text-align: start\">Current Job Openings:</p><ol><li><p>Graphic Designer</p><ul><li><p>Job Description: We are seeking a creative and talented graphic designer to join our team. In this role, you will be responsible for designing visually appealing graphics for our website, marketing materials, and social media platforms.</p></li><li><p>Qualifications:</p><ul><li><p>Proficient in Adobe Creative Suite (Photoshop, Illustrator, InDesign)</p></li><li><p>Strong portfolio showcasing graphic design skills</p></li><li><p>Attention to detail and a good eye for aesthetics</p></li></ul></li><li><p>How to Apply: Please email your resume, portfolio, and a brief introduction to <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"mailto:careers@cartify.dev\"><strong><u>careers@cartify.dev</u></strong></a> with the subject line \"Graphic Designer Application - [Your Name].\"</p></li></ul></li><li><p>Customer Support Specialist</p><ul><li><p>Job Description: We are seeking a customer support specialist to provide exceptional service and assistance to our customers. In this role, you will be responsible for handling inquiries, resolving issues, and ensuring a positive customer experience.</p></li><li><p>Qualifications:</p><ul><li><p>Excellent communication and problem-solving skills</p></li><li><p>Strong customer service orientation</p></li><li><p>Familiarity with gaming products and industry</p></li></ul></li><li><p>How to Apply: Please email your resume and a brief introduction to <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"mailto:careers@cartify.dev\"><strong><u>careers@cartify.dev</u></strong></a> with the subject line \"Customer Support Specialist Application - [Your Name].\"</p></li></ul></li></ol><p style=\"text-align: start\">How to Apply:</p><p style=\"text-align: start\">To apply for any of the above positions or to express your interest in joining our team, please send an email to <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"mailto:careers@cartify.dev\"><strong><u>careers@cartify.dev</u></strong></a> with the following information:</p><ul><li><p>Resume/CV</p></li><li><p>Portfolio (if applicable)</p></li><li><p>Brief introduction or cover letter</p></li></ul><p style=\"text-align: start\">Please include the job title you are applying for in the subject line of your email. We appreciate all applications, but only shortlisted candidates will be contacted for further steps.</p><p style=\"text-align: start\">Join our passionate team and be part of Cartify\'s journey in shaping the gaming industry. We can\'t wait to hear from you!</p><p style=\"text-align: start\">Cartify<br>123 Gaming Avenue, City<br>Website: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.cartify.dev\"><strong><u>www.cartify.dev</u></strong></a></p>', NULL, NULL, '2023-06-22 20:34:35', '2023-06-22 20:34:00', '2023-06-22 20:43:30'),
(7, 'default', 'Affiliates', 'affiliates', '<p>Welcome to the Cartify Affiliates program. We are excited to partner with passionate content creators, influencers, and website owners who share our love for gaming and want to join us in promoting the best gaming products and experiences to the gaming community.</p><p>Why Join Cartify\'s Affiliates Program:</p><ol><li><p>Earn Competitive Commissions: As a Cartify affiliate, you have the opportunity to earn competitive commissions on every qualifying sale made through your unique affiliate links. The more you promote, the more you can earn.</p></li><li><p>Exclusive Promotions and Offers: Gain access to exclusive promotions, special discounts, and limited-time offers that you can share with your audience. This helps drive engagement and boosts your earning potential.</p></li><li><p>Diverse Product Catalog: Cartify offers a diverse range of gaming products, accessories, and merchandise from leading brands. This means you can promote a wide variety of products that align with your audience\'s interests and preferences.</p></li><li><p>Dedicated Affiliate Support: We provide dedicated support to our affiliates. Our affiliate team is available to assist you with any questions, provide marketing materials, and offer guidance on optimizing your affiliate performance.</p></li></ol><p>How It Works:</p><ol><li><p>Apply: Complete the Cartify Affiliates Program application form. We review each application to ensure it aligns with our program\'s guidelines.</p></li><li><p>Get Approved: Once your application is reviewed and approved, you will receive a confirmation email with instructions on how to access your affiliate account.</p></li><li><p>Promote: Start promoting Cartify\'s products on your website, blog, social media channels, or other platforms using your unique affiliate links, banners, and promotional materials provided in your affiliate account.</p></li><li><p>Earn Commissions: Every time a customer makes a purchase through your affiliate links, you earn a commission on the sale. We provide real-time tracking and reporting so you can monitor your performance and earnings.</p></li><li><p>Receive Payments: Commissions are paid on a regular basis, with multiple payment options available for your convenience.</p></li></ol><p>Join Cartify\'s Affiliates Program:</p><p>To apply and become a Cartify affiliate, please visit <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://cartify.dev/affiliates\">https://cartify.dev/affiliates</a> and complete the application form. We will review your application and notify you of the status within 24 hours.</p><p>If you have any questions or require further information about our Affiliates Program, please contact our affiliate support team at affiliates@cartify.dev.</p><p>We look forward to partnering with you and growing together as we bring the best gaming products and experiences to gamers worldwide.</p><p>Cartify<br>123 Gaming Avenue, City<br>Website: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.cartify.dev\"><strong><u>www.cartify.dev</u></strong></a></p>', NULL, NULL, '2023-06-22 20:37:09', '2023-06-22 20:36:01', '2023-06-22 20:43:50');
INSERT INTO `pages` (`id`, `template`, `title`, `slug`, `content`, `seo_title`, `seo_description`, `published_at`, `created_at`, `updated_at`) VALUES
(8, 'default', 'Cookie consent', 'cookie-consent', '<p>This Cookie Consent page explains how Cartify (\"we,\" \"us,\" or \"our\") uses cookies and similar tracking technologies on our website. By continuing to browse and use our website, you consent to the use of cookies as described in this policy.</p><p style=\"text-align: start\">What are Cookies?</p><p style=\"text-align: start\">Cookies are small text files that are placed on your device (computer, tablet, or mobile) when you visit a website. They help us provide a better user experience and analyze website traffic. Cookies may be temporary (session cookies) or stored on your device until they expire or are manually deleted (persistent cookies).</p><p style=\"text-align: start\">How We Use Cookies:</p><ol><li><p>Essential Cookies: These cookies are necessary for the functioning of our website and enable basic features, such as page navigation, secure login, and access to shopping cart functionality. Without these cookies, certain services on our website may not function properly.</p></li><li><p>Analytics Cookies: We use analytics cookies to collect information about how visitors use our website. This helps us analyze data such as visitor demographics, popular pages, and browsing patterns. The information gathered is used to improve our website and enhance the user experience.</p></li><li><p>Marketing Cookies: Marketing cookies are used to track visitors across websites. They allow us to deliver personalized advertisements and promotions based on your browsing behavior and interests. These cookies help us tailor our marketing efforts to be more relevant and engaging.</p></li></ol><p style=\"text-align: start\">Managing Your Cookie Preferences:</p><p style=\"text-align: start\">You have the option to manage your cookie preferences and control whether to accept or decline cookies. You can typically modify your browser settings to disable or block cookies entirely or receive notifications when cookies are being sent. However, please note that disabling certain cookies may impact the functionality and performance of our website.</p><p style=\"text-align: start\">To learn more about managing cookies and adjusting your preferences, visit the \"Help\" or \"Settings\" section of your browser or device.</p><p style=\"text-align: start\">Third-Party Cookies:</p><p style=\"text-align: start\">We may allow third-party service providers to place cookies on our website to assist with analytics, marketing, and other functionalities. These third parties have their own privacy policies and may collect information about your browsing activity on our website and other sites you visit.</p><p style=\"text-align: start\">Our Privacy Policy:</p><p style=\"text-align: start\">For more information about how we collect, use, and protect your personal data, please read our <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"/pages/privacy-statement\">Privacy Policy</a>. The Privacy Policy outlines our data processing practices and explains your rights regarding your personal information.</p><p style=\"text-align: start\">Contact Us:</p><p style=\"text-align: start\">If you have any questions or concerns about our use of cookies or this Cookie Consent page, please contact us at support@cartify.dev.</p><p style=\"text-align: start\">Cartify<br>123 Gaming Avenue, City<br>Website: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.cartify.dev\"><strong><u>www.cartify.dev</u></strong></a></p>', NULL, NULL, '2023-06-22 20:43:34', '2023-06-22 20:40:29', '2023-06-22 20:43:34');
