INSERT INTO `products` (`id`, `name`, `slug`, `excerpt`, `description`, `price`, `status`, `seo_title`, `seo_description`, `published_at`, `created_at`, `updated_at`) VALUES
(122, 'Samsung Galaxy S22 Ultra', 'samsung-galaxy-s22-ultra', 'Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', '<p>With its new look incorporating an armour aluminium frame, the Samsung Galaxy S22 Ultra looks incredible and durable. Furthermore, the inclusion of the built-in S-Pen brings a new level of productivity with improved latency for a natural writing and drawing experience.</p><p>The powerful 2200 features new 4nm technology, making it the fastest chip for incredible performance and an optimised photography and gaming experience.</p><p>The Dynamic AMOLED 2X display with Vision Booster reduces glare, offering 1750 nits at its peak performance. In addition, the 120Hz adaptive refresh rate keeps scrolling smooth by adjusting to on-screen contents for a better experience.</p><p>Why carry a separate camera to photo opportunities? The camera technology contained within the Samsung Galaxy S22 Ultra now exceeds the average digital camera.</p><p>With the 108MP Wide Angle Primary, you can achieve an awe-inspiring level of detail in your images while also bringing them to life with rich colours and hues.</p><p>Nightography offers a sufficient leap in Samsung’s video technology. With auto framerate detecting lighting and shifts to an optimal fps speed automatically.</p><p>Bolstered by the 4nm processor with Super Night Solution clearing up the noise in each frame, you can record with consistent, stunning details from sun up to sundown.</p><p>Capture close up detail with the 100X Space Zoom for creating incredible images.</p><p>Super-fast 5G technology allows you to download apps movies faster than ever before.</p><p>There is no need to worry about an occasional splash of water or rain as the Galaxy S21 Ultra 5G is IP68 certified. In addition, the armour aluminium frame offers a new level of protection against accidents, making the Galaxy S22 Ultra more durable.</p><p>A long-lasting 5,000 mAh battery offers a full day of usage, even for demanding users. While also intelligently adjusting performance to compliment your mobile habits. The 45W Adaptive Fast Charging will have you connecting with friends again quickly. Fast Wireless charging and PowerShare charging are also available for a convenient way to charge accessories and the Galaxy S22 Ultra.</p><p>It is available in Burgundy, Phantom Black, Phantom White and Green.</p><p><strong>Box Contents</strong></p><ul><li><p>Samsung Galaxy S22 Ultra 5G</p></li><li><p>USB Type-C data cable</p></li><li><p>Ejection pin</p></li><li><p>Quick Start Guide</p></li></ul><p><strong>Samsung Region Lock</strong></p><p>Samsung implements a \'region lock\' on all new smartphones. This restricts use of SIM cards to the original region their phones are intended to be sold in.</p><p>Clove Technology sells Samsung phones intended for the “European” region, which covers the UK, mainland Europe and some other select territories. The full list is below.</p><p>If you are ordering for delivery to a destination outside of this list, we will need to activate the phone prior to shipping, so that you can use a local SIM card.</p><p>To activate the phone, we must turn it on, complete set-up with a European SIM installed, then make at least 5 minutes of continuous voice call with this SIM.</p><p>Without activation, you can only use the device outside of the listed countries if \'roaming\' with a SIM card from the intended sales region.</p><p>If this activation procedure is not followed then the device will lock if you attempt to use a SIM card from outside of these regions.</p><p>COUNTRY LIST: **All member states of the E.E.A and the following additional territories: Albania, Andorra, Bosnia and Herzegovina, Former Yugoslav Republic of Macedonia (F.Y.R.O.M), Monaco, Montenegro, San Marino, Serbia and Vatican City.</p><p>IF YOUR CHOSEN DELIVERY COUNTY IS NOT LISTED, CLOVE TECHNOLOGY WILL BREAK THE SEAL ON THIS DEVICE AND ACTIVATE IT. YOU MUST AGREE TO THIS PROCEDURE IN THE CHECKOUT BEFORE THE SALE WILL COMPLETE.</p>', 0.00, 'ACTIVE', NULL, NULL, '2023-06-05 16:08:59', '2022-12-27 18:44:57', '2022-12-27 18:49:51'),
(130, 'Xiaomi 12T Pro', 'xiaomi-12t-pro', 'Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', '<p>Master every scene with the Xiaomi 12 and its 50MP professional-grade camera. The all-new focusing technology Xiaomi ProFocus uses subject learning and a tracking algorithm to capture subjects easily, so everything is in focus.</p><p>The 6.28\" AMOLED Dot Display offers vibrant, true-to-life colours with HDR 10+ and Dolby Vision, further enhancing your movie experience and making it more immersive. In addition, AdaptiveSync changes the refresh rate depending on your usage up to 120Hz. Interact with your phone quickly without lag with the 480Hz touch sampling rate.</p><p>Sound by Harman Kardon and Dolby Atmos effects makes your audio experience more enjoyable with smooth, high-quality sound.</p><p>Take your performance to the next level with the Snapdragon 8 Gen 1 processor, enhancing your gaming and content viewing. With an extra-large VC, the LiquidCool board improves heat flow and reduces core temperatures, increasing frame rates and keeping your smartphone cool in every situation.</p><p>Having a large 4,500 mAh battery with 67W wired and 50W wireless turbocharging means, you have a full day of usage and fully charge your phone in only 39 minutes.</p><p><strong>Box Contents</strong></p><ul><li><p>Xiaomi 12</p></li><li><p>Adapter</p></li><li><p>USB Type-C Cable</p></li><li><p>SIM Eject Tool</p></li><li><p>Protective Case</p></li><li><p>Quick Start Guide</p></li><li><p>Warranty Card</p></li></ul>', 549.00, 'ACTIVE', NULL, NULL, '2023-06-05 16:08:59', '2022-12-28 03:07:42', '2022-12-28 03:11:34'),
(131, 'Xiaomi 12 Pro', 'xiaomi-12-pro', 'Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', '<p>Master every scene with the Xiaomi 12 and its 50MP professional-grade camera. The all-new focusing technology Xiaomi ProFocus uses subject learning and a tracking algorithm to capture subjects easily, so everything is in focus.</p><p>The 6.28\" AMOLED Dot Display offers vibrant, true-to-life colours with HDR 10+ and Dolby Vision, further enhancing your movie experience and making it more immersive. In addition, AdaptiveSync changes the refresh rate depending on your usage up to 120Hz. Interact with your phone quickly without lag with the 480Hz touch sampling rate.</p><p>Sound by Harman Kardon and Dolby Atmos effects makes your audio experience more enjoyable with smooth, high-quality sound.</p><p>Take your performance to the next level with the Snapdragon 8 Gen 1 processor, enhancing your gaming and content viewing. With an extra-large VC, the LiquidCool board improves heat flow and reduces core temperatures, increasing frame rates and keeping your smartphone cool in every situation.</p><p>Having a large 4,500 mAh battery with 67W wired and 50W wireless turbocharging means, you have a full day of usage and fully charge your phone in only 39 minutes.</p><p><strong>Box Contents</strong></p><ul><li><p>Xiaomi 12</p></li><li><p>Adapter</p></li><li><p>USB Type-C Cable</p></li><li><p>SIM Eject Tool</p></li><li><p>Protective Case</p></li><li><p>Quick Start Guide</p></li><li><p>Warranty Card</p></li></ul>', 1049.00, 'ACTIVE', NULL, NULL, '2023-06-05 16:08:59', '2022-12-28 17:07:48', '2022-12-28 17:10:24'),
(132, 'Samsung OLED', 'new-product', '', '<p>Let Samsung OLED immerse you with unbelievable details and picture quality. Our NQ4 Al Gen2 Processor upscales your favorite movies and shows in brilliant 4K resolution, while OLED color-mapping and brightness boosting technologies give you a more accurate picture that lets your content come to life.</p>', 1000.00, 'ACTIVE', NULL, NULL, '2024-08-18 10:36:54', '2024-08-18 10:33:34', '2024-08-18 10:37:06');
